import React from "react";

export default class Navigation extends React.Component {
    render() {
        return (
            <>
                <nav className="navbar">
                    <div className="navbar-left">
                        <span>Friends</span>
                        <span>Online</span>
                        <span>All</span>
                        <span>Pending</span>
                        <span>Suggestions</span>
                        <span>Blocked</span>
                        <button>Add friend</button>
                    </div>
                    <div className="navbar-right">
                        <span>a</span>
                        <span>b</span>
                        <span>c</span>
                    </div>
                </nav>
            </>
        );
    }
}
